new Thread(new Runnable(){
  @Override public void run(){
    try {
      Channel httpChannel=null;
      logger.info("Starting MockServer on" + (port != null ? " serverPort " + port : "") + (securePort != null ? " secureServerPort " + securePort : ""));
      if (port != null) {
        httpChannel=new ServerBootstrap().group(bossGroup,workerGroup).channel(NioServerSocketChannel.class).childHandler(new MockServerInitializer(mockServerMatcher,logFilter,MockServer.this,false)).option(ChannelOption.SO_BACKLOG,1024).bind(port).sync().channel();
      }
      Channel httpsChannel=null;
      if (securePort != null) {
        httpsChannel=new ServerBootstrap().group(bossGroup,workerGroup).channel(NioServerSocketChannel.class).childHandler(new MockServerInitializer(mockServerMatcher,logFilter,MockServer.this,true)).option(ChannelOption.SO_BACKLOG,1024).bind(securePort).sync().channel();
      }
      hasStarted.set("STARTED");
      if (httpChannel != null) {
        httpChannel.closeFuture().sync();
      }
      if (httpsChannel != null) {
        httpsChannel.closeFuture().sync();
      }
    }
 catch (    InterruptedException ie) {
      logger.error("MockServer receive InterruptedException",ie);
    }
 finally {
      bossGroup.shutdownGracefully();
      workerGroup.shutdownGracefully();
    }
  }
}
)
